def isPrime(n):
    if n < 1:
        return False
    if n <= 3:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i = i + 6
    return True

def determine_prime_or_composite(hidden_number):
    cnt = 0
    primes = [2, 3, 5, 7]
    div = []
    for prime in primes:
        if hidden_number % prime == 0:
            div.append(prime)
            cnt += 1
    if cnt == 0:
        return 'prime'
    elif len(div) == 1:
        i = div[0]
        x = 2
        cnt = 0
        while i ** x < 101:
            if hidden_number % i ** x == 0:
                cnt += 1
                break
            x += 1
        new = []
        for i in range(10, 50):
            if isPrime(i):
                new.append(i)
        for prime in new:
            if div[0] * prime > 100:
                break
            if hidden_number % prime == 0:
                cnt += 1
        if cnt == 0:
            return 'prime'
        else:
            return 'composite'
    else:
        return 'composite'

